columnDefs.render:
function(data, type, row, meta) {
    return type !== 'display' ? data : DTWidget.formatRound(data, 5, 3, ",", ".", null);
  }

ajax.data:
function(d) {
d.search.caseInsensitive = true;
d.search.smart = true;
d.escape = true;
var encodeAmp = function(x) { x.value = x.value.replace(/&/g, "%26"); }
encodeAmp(d.search);
$.each(d.columns, function(i, v) {encodeAmp(v.search);});
}

x.callback:
function(table) {

            table.on("click", "td:nth-child(1)", function(d) {
              const participant_id = d.currentTarget.innerText;
              console.log(
                `Selected participant ID: ${participant_id}`
              );
              const namespace = table.table().container().parentNode.id;
              const inputName = `${namespace}-participant`;
              console.log(
                `Input Name: ${inputName}`
              );
              Shiny.setInputValue(inputName, participant_id);
            })

}
